import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="root">
      <div className="topbar">Game P,W Scores</div>
      <div className="bar1">
        Produce
      </div>
      <div className="bar2">
        Wares
      </div>
      <div className="bar3">
        Auction
      </div>
      <div className="bar4">
        History
      </div>
    </div>
  );
}

export default App;
